export default function renderLandingPage() {
    return `
    <div class="landingVideo-container">
    <iframe class="landingVideo" width="560" height="315" src="https://www.youtube.com/embed/BWuafJtMrBE?start=201?autoplay=1" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
    `;
}
